import React from 'react';
import { Icon } from '../../icon';
import SearchItem from '../../data/searcItem.json';

const SearchItemUser = ({ search }) => {
    return (
        <>
            <div className='overflow-y-auto h-screen'>
                {search}
                {SearchItem.map((searchBox) => (
                    <div key={searchBox.id?.search} className='px-6 flex justify-between items-center py-2 cursor-pointer duration-150 ease-in-out hover:bg-[#fafafa]'>
                        <div className='flex items-center'>
                            <img src={searchBox.image} className='w-14 h-14 object-contain rounded-full' alt='' />
                            <div className='flex flex-col ml-3'>
                                <span className='text-sm font-semibold'>{searchBox.title}</span>
                                <span className='text-[#8f8f8f] font-normal text-sm'>{searchBox.description}</span>
                            </div>
                        </div>
                        <span className='cursor-pointer text-[#8e8e8e]'>
                            <Icon name="close" size={16} />
                        </span>
                    </div>
                ))}
            </div>
        </>
    );
};

export default SearchItemUser;
